import React from 'react'
import { UserSearch, ClipboardPlus } from 'lucide-react';

function NurseSide() {
    return (
        <div>
            <ul>
                <li><UserSearch /> Patients</li>
                <li><ClipboardPlus /> Consultation</li>
                <li>History of patients</li>
                <li></li>
            </ul>
        </div>
    )
}

export default NurseSide
